console.log('Hola Mundo!!!!')

const nombre = 'Sebastian';
const apellido = 'Colombo';

let valorDado = 5;
valorDado = 4;

console.log(nombre, apellido, valorDado)

if (true){
    let valorDado = 6;
    console.log(valorDado)
}

console.log(nombre, apellido, valorDado)
